	public static HashMap<Integer, HashMap<String, String>> parseXMLString(
			String xml) {
		HashMap<Integer, HashMap<String, String>> parsedXML = new HashMap<Integer, HashMap<String, String>>();

		String[] splitXML = xml.split("<");

		HashMap<String, String> vm = null;

		for (String attr : splitXML) {
			if (attr != null && !attr.isEmpty()) {
				if (attr.charAt(0) == '!' || attr.charAt(0) == '/') {
					continue;
				}

				String[] splitAttr = attr.split(">");

				if (splitAttr.length > 0) {
					switch (splitAttr[0]) {
					case "VM": // New VM map
						vm = new HashMap<String, String>();
						break;
					case "HOST":
						vm = new HashMap<String, String>();
						break;
					case "ID": // Add VM map to list of VMs
						int newVMID = Integer.parseInt(attr.substring(3));
						parsedXML.put(newVMID, vm);
						break;
					default: // Add attribute to VM map
						if (splitAttr.length == 2) {
							vm.put(splitAttr[0], splitAttr[1]);
						}
						break;
					}
				}
			}
		}

		return parsedXML;
	}

